$(document).ready(function(){
    let email = localStorage.email;
    if(!email){
        window.location.replace('login.html')
    }

   

    $('[data-toggle="datepicker"]').datepicker({
        format:'yyyy/mm/dd'
    });
    // $('#a').val(Math.floor((Math.random() * 10000) + 1));
    $('#a').on('keyup',function(){
        this.value = this.value.replace(/[^0-9\.]/g,'');
    })

    $('.change').on('keyup',function(){
        // this.value = this.value.toFixed(2)
        console.log('waleed');
    })

    $('.llo').on('keyup', function(){
        this.value = this.value.replace(/[^0-9\.]/g,'');
    })

    $('#b').on('keyup', function(){
        this.value = this.value.replace(/[^0-9\.]/g,'');
    })

    var total;
    // On discount change
    $('#discount').on('change',function(){
        $('#mk').text($('#j').val());
        var dis = $("#discount option:selected").val();
        var after_dis = dis/100;
        var diss = after_dis*total;
        // console.log(diss);
        $('#aftertdis').val((diss).toFixed(2))
        $('#fff').val((total-diss).toFixed(2));
        $('#ee').text((total).toFixed(2));

        
    })


    // Calculate Total
    var value;
    var quantity;
    $('#tbody').on('keypress','tr',function(){
       
        var vtol = $(this).find('h6').attr('id');
        console.log(vtol);
        
        // var val = 
        $(this).find('.value').on('keyup',function(){
            // value = this.value = this.value.replace(/[^1-9\.]/g,'');
            value = this.value = this.value.replace(/[^0-9\.]/g,'');

            $('#name').text($('#n').val());
            $('#address').text($('#m').val());
            $('#port').text($('#o').val());
            $('#city').text($('#p').val());
            $('#lk').text($('#b').val());
            $('#fk').text($('#a').val());
            $('#sk').text($('#a').val());
        });


        // var quantity = 
        $(this).find('.quantity').on('keyup',function(){
            quantity = this.value = this.value.replace(/[^0-9\.]/g,'');
            
            console.log(value*quantity)
            $('#'+vtol).text((value*quantity).toFixed(2));
            total = 0;

            $('#tbody tr').each(function(k,v){
                var vtotal = parseInt($(this).find('td:eq(4)').text());
                total+=vtotal;
                $('#t').val((total).toFixed(2));
            })
        });
    })

    

    // Add Row
    var id=1;
    $('#tbody').on('click','.add-row',function(e){
        e.preventDefault();
        var tbody = $('#tbody');
        id++;
        tbody.append(`
        <tr>
            <td style="width:50px"><input type="text" class="llo form-control form-control2 form-control-sm"></td>
            <td ><textarea name="" class="form-control form-control2 form-control-sm tedtarea" id="" rows="5" col="5" ></textarea></td>
            <td style="width:50px"><input type="text" class="value form-control form-control2 form-control-sm"></td>
            <td style="width:50px"><input type="text" class="quantity change form-control form-control2 form-control-sm"></td>
            <td class="lopo"><h6 class="total alignl" id="total`+id+`"></h6></td>
            <td class="display">
                <a href="#" class="add-row plus-btn btn-success btn btn-sm"><i class="fa fa-plus"></i></a>
                <a href="#" class="delete-row minus-btn btn-danger btn btn-sm"><i class="fa fa-minus"></i></a>
            </td>
        </tr>
        `)
    })

    
    // Delete Table
    $('#tbody').on('click','.delete-row',function(e){
        e.preventDefault();
        $(this).parent().parent().remove();
    })


    // PDF DOWNLOAD 
    $('#download-pdf').on('click',function(e){
        e.preventDefault();
        $('.minus-btn').css('display','none');
        $('.plus-btn').css('display','none');
        $(this).css('display','none');
        $('.display').css('display','none');
        $('#hide').css('display','none');
        $('.lopo').css('text-align','center')
        var img = 'data:image/jpeg;base64,';
        var second = `data:image/png;base64,`;
        $('.form-control1').css({'border':'0','color':'black','font-weight':'bold','font-size':'28px'});
        $('.form-control2').css({'border':'0','color':'black','font-size':'24px'});
        $('#top_layer').css({'margin-top':'-60px','margin-bottom':'10px'});
        $('#faktura').css({'font-size':'36px','font-weight':'bold','border':'0','color':'black','width':'auto'});
        $('#n').css('padding','0');
        $('#m').css('padding','0');
        $('#o').css('padding','0');
        $('#p').css('padding','0');
        $('#non').css('margin-top','-10px');
        $('.alignl').css({'margin-top':'15px'})
        
        var pdf = new jsPDF('p','pt','a4');
        pdf.addHTML(document.body,5,0,function() {
            pdf.addImage(img, 'JPEG',50,10,150,75);
            pdf.addImage(second, 'png',40,510,80,15);
            pdf.save('Document.pdf');
            location.reload();
        });
    });

    


})
